import React, { useContext } from 'react';
import { AppState } from '../context';
import { Grid, Header, Container, Card, Menu, Segment } from 'semantic-ui-react';

const HomePage = () => {
  const state = useContext(AppState);
  const { data } = state;
  console.log(data);
  return (
    <Container>
      <PageHeader />
    </Container>
  );
};

const PageHeader = () => {
  return (
    <Segment
      basic
      attached='top'
      style={{ backgroundColor: "orange", textAlign: "center" }}
      fluid
    >
      <Header content="Marketplace" size="large" />
    </Segment>
  );
}
export default HomePage;
